import React, { useState } from 'react';


const Clock = () => {
    var time = new Date().toLocaleTimeString();
    const [ctime, updated] = useState(time);
      
    return(
        <>
            {time}
            <button>Get time</button>
        </>
    )
}

export default Clock;
